`,paraId:12,tocIndex:4},{value:"You can also follow the following related issues to get the latest progress:",paraId:13,tocIndex:4},{value:"https://github.com/ant-design/ant-design/issues/46053",paraId:14,tocIndex:4},{value:"https://github.com/vercel/next.js/issues/58817",paraId:14,tocIndex:4},{value:"You may encounter the following error when using ",paraId:15,tocIndex:5},{value:"@ant-design/web3",paraId:15,tocIndex:5},{value:" in ",paraId:15,tocIndex:5},{value:"Remix",paraId:15,tocIndex:5},{value:" (Not the Remix IDE of Ethereum):",paraId:15,tocIndex:5},{value:"Error: require() of ES Module ... from ... not supported.",paraId:16,tocIndex:5},{value:"SyntaxError: Cannot use import statement outside a module",paraId:16,tocIndex:5},{value:"This is because Remix does not go through the relevant compilation logic when loading dependent packages under ",paraId:17,tocIndex:5},{value:"node_modules",paraId:17,tocIndex:5},{value:". You may need to manually add the ",paraId:17,tocIndex:5},{value:"serverDependenciesToBundle",paraId:17,tocIndex:5},{value:" configuration in Remix configuration file ",paraId:17,tocIndex:5},{value:"remix.config.js",paraId:17,tocIndex:5},{value:":",paraId:17,tocIndex:5},{value:`/** @type {import('@remix-run/dev').AppConfig} */
